import { useGetStocksQuery, useGetStocksState, stockApiSlice } from '../redux/stockApiSlice';
import { Ticker } from './Ticker';
import { useSelector } from 'react-redux';

export function Tickers () {

  const { interval } = useSelector(state => state.stocks)

  const {
    data,
    isLoading,
    isSuccess,
    isError,
    error
  } = useGetStocksQuery(interval)

  if (isLoading) {
    console.log('Loading...')
  } else if (isSuccess) {
    console.log(data.flat())
  } else if (isError) {
    console.log(error);
  }

  const useQueryStateResult = stockApiSlice.endpoints.getStocks.useQueryState(interval, { skip: !!interval })

  return (
    <div className='container mx-auto'>
      {console.log(useQueryStateResult)}
      {
        isSuccess ? 
        data.flat().map((item, i) => 
          <Ticker 
            key={i + 1}
            ticker={item.ticker}
            exchange={item.exchange}
            price={item.price}
            change={item.change}
            change_percent={item.change_percent}
          />
        )
        : 
        null

     }
    </div>
  )
}
